import React from 'react';
import klimalogo from '../img/klima logo.png';
import hklimatxt from '../img/klima text.png';
import rerend from '../img/rerend logo.png';
import gp from '../img/gp logo.png';
import gp2 from '../img/gp logo 2.png';
import download from '../img/download btn.png';
import developer1 from '../img/devs/shannen.png'; 
import developer2 from '../img/devs/vinnie.png';
import developer3 from '../img/devs/mane.png';
import developer4 from '../img/devs/kyan.png';
import '../css/homepage.css'; 

const Homepage = () => {
  return (
    <div className="background_homepage">
      <div className="centered_container">
        <img src={hklimatxt} alt="KLIMA Logo" className="title_img" />
        <h1 className='subtitle'>Act Now for Nature – A Future Worth Protecting</h1>

        {/* Download Button */}
        <a  href="/login">
          <button className="dl_button">
            <img src={download} alt="Download" className="button_img" />
          </button>
        </a>
      </div>

      {/* Game Information Section */}
      <div className="main_container">
        <div className="game_info">
          <h2 className="game_title">About the Game</h2>
          <p className="game_description">
          Klima is a 3D interactive mini game where it tackles simple climate change scenarios in a spherical world, as you play through the game, you gain information or lessons about climate change
          </p>
          <p className="game_description">
            Phasellus sed felis tincidunt, auctor arcu in, dictum nunc. Aenean ultricies vitae orci in lacinia. Sed vitae arcu at quam cursus tincidunt. Praesent sit amet leo libero.
          </p>
        </div>

        {/* About Us Section */}
        <div className="about_us">
          <h2 className="section_title">Meet Our Team</h2>
          <div className="developer_profiles">
            {/* Developer Profile 1 */}
            <div className="developer_card">
              <img src={developer1} alt="Developer 1" className="developer_photo" />
              <h3 className="developer_name">Shannen</h3>
              <p className="developer_role">PROJECT MANAGER</p>
            </div>

            {/* Developer Profile 2 */}
            <div className="developer_card">
              <img src={developer2} alt="Developer 2" className="developer_photo" />
              <h3 className="developer_name">Vinnie</h3>
              <p className="developer_role">SYSTEM ADMINISTRATOR</p>
            </div>

            {/* Developer Profile 3 */}
            <div className="developer_card">
              <img src={developer3} alt="Developer 3" className="developer_photo" />
              <h3 className="developer_name">Jere Mane</h3>
              <p className="developer_role">BACKEND DEVELOPER</p>
            </div>

            {/* Developer Profile 4 */}
            <div className="developer_card">
              <img src={developer4} alt="Developer 4" className="developer_photo" />
              <h3 className="developer_name">Kyan</h3>
              <p className="developer_role">FRONTEND DEVELOPER</p>
            </div>
          </div>
        </div>

        {/* Partner Section */}
        <div className="partners_section">
          <h2 className="section_title">Our Partner</h2>
          <div className="partner_card">
            <img src={gp2} alt="Partner Logo" className="partner_logo" />
            <p className="partner_info">Greenpeace is a community united by a mission to protect the planet and ensure a green, peaceful future. We’ve led the fight against environmental destruction, advocating for the planet’s rights as part of a global movement that challenges power with courage. <a className="gp_link"  href="https://www.greenpeace.org/philippines/about-us/">Know more</a></p>
          </div>
        </div>

         {/* Footer */}
         <footer className="hfooter">
          <div className="hfooter_container">
            <a href="/privacy-policy" className="footer_link">Privacy Policy</a>
            <a href="/terms-of-service" className="footer_link">Terms of Service</a>
            <a href="/about_us" className="footer_link">About Us</a>
            <a href="/terms-of-service" className="footer_link">Our Partner</a>
            <p className="hfooter_copy">&#169; KLIMA 2024 | All rights reserved.</p>
            <img src={gp} alt="Bottom Left" className="bottom_left" />
            <img src={rerend} alt="Bottom Mid" className="bottom_mid" />
            <img src={klimalogo} alt="Bottom Right" className="bottom_right" />
          </div>
        </footer>

      </div>
    </div>
  );
};

export default Homepage;
